import {NavLink} from 'react-router-dom';
import './Navigation.css'

const Navigation = () => (
    <div className="Navigation">
        <NavLink activeClassName="active" exact to='/'>DISCOVER</NavLink>
        <NavLink activeClassName="active" to='/addTask'>LIBRARY</NavLink>
        <NavLink activeClassName="active" to='/login'>LOGO</NavLink>
        <p>search tab</p>
        <p>sign up</p>
    </div>
);

export default Navigation;
